        external
        view
        returns (uint256)
    {
        return (_amount * 1e18) / priceCWOLF;
    }

    function setBNBPriceInDollars(uint256 _newPrice) external {
        require(
            msg.sender == owner() || msg.sender == minterWalletAddress,
            "Not allowed"
        );
        priceBNB = _newPrice;
        emit PriceBNBChanged(_newPrice);
    }

